(2086, 1, '2017-05-29 05:11:04', '2017-05-29 05:11:04', '[row]\r\n[span6]\r\n<div class="client-box">\r\n<img src="http://localhost/akinito/wp-content/uploads/2017/05/developer-1.jpg" alt="" width="545" height="330" class="aligncenter size-full wp-image-2078" />\r\n<h4>Developers</h4>\r\nThe Developer philosophy we apply at Akinito is:\r\n<ol>\r\n 	<li>Developers profit from adding value rather than buying a value added product.</li>\r\n 	<li>Developers prefer to develop, than to spend time looking for sites.</li>\r\n 	<li>Development sites should encompass both traditional (e.g: contracts for sale) and non-traditional (e.g: options) approaches to purchase.</li>\r\n</ol>\r\n</div>\r\n[/span6]\r\n[span6]\r\n<div class="client-box">\r\n<img src="http://localhost/akinito/wp-content/uploads/2017/05/investor.jpg" alt="" width="545" height="330" class="aligncenter size-full wp-image-2079" />\r\n<h4>Investors</h4>\r\nThe Investor philosophy we apply at Akinito is:\r\n<ol>\r\n 	<li>Investor returns are a combination of cash flow, capital growth and added value potential.</li>\r\n 	<li>Investors think discount, blue-chip or well roundedness in any investment offering.</li>\r\n 	<li>Investment properties should encompass both traditional (eg:contracts for sale) and non-traditional (e.g: options) approaches to purchase.</li>\r\n</ol>\r\n</div>\r\n[/span6]\r\n[/row]\r\n[row]\r\n[span6]\r\n<div class="client-box">\r\n<img src="http://localhost/akinito/wp-content/uploads/2017/05/tenants.jpg" alt="" width="545" height="330" class="aligncenter size-full wp-image-2085" />\r\n<h4>Tenants</h4>\r\nThe Tenant philosophy we apply at Akinito is:\r\n<ol>\r\n 	<li>Tenants fall into either a single site or multi-site category.</li>\r\n 	<li>Tenants will either prefer greenfield (pre-commitment) or established sites.</li>\r\n 	<li>Tenants prefer property choices over and above what may be offered in a typical market place.</li>\r\n</ol>\r\n</div>\r\n[/span6]\r\n[span6]\r\n<div class="client-box">\r\n<img src="http://localhost/akinito/wp-content/uploads/2017/05/owner.jpg" alt="" width="545" height="330" class="aligncenter size-full wp-image-2084" />\r\n<h4>Owners</h4>\r\nThe Owner philosophy we apply at Akinito is:\r\n<ol>\r\n 	<li>Owners prefer offers over marketing campaigns and publicity.</li>\r\n 	<li>Owners prefer price or terms or both that deal with their individual needs.</li>\r\n 	<li>Sales should encompass both traditional (e.g: contracts for sale) and non-traditional (e.g: options) approaches to purchase depending on the owners needs.</li>\r\n</ol>\r\n</div>\r\n[/span6]\r\n[/row]', 'Our Clients', '', 'inherit', 'closed', 'closed', '', '2034-revision-v1', '', '', '2017-05-29 05:11:04', '2017-05-29 05:11:04', '', 2034, 'http://localhost/akinito/vivamus-eget-nibh/2034-revision-v1/', 0, 'revision', '', 0),
