(2091, 1, '2017-05-29 09:41:23', '2017-05-29 09:41:23', '[row]\n[span12]\n<div class="service-boxes"></div>\n[/span12]\n[span6]\n<img src="http://localhost/akinito/wp-content/uploads/2011/07/service1-2.jpg" alt="" width="555" height="315" class="alignleft size-full wp-image-2094" />\n[/span6]\n[span6]\n<div class="service-boxes">\n<h3>Membership</h3>\n<p>Akinito is an exclusive, elite, informed, online, licensed estate agency “for lovers of real estate and lifestyle”. Our members are typically experienced, high net worth individuals or corporate tenants who value their time and expect results. By partnering with Akinito our members can enjoy their lifestyle whilst we get to work.  Membership benefits include :</p>\n<ul>\n	<li>Free 24/7 access to the principal</li>\n	<li>Free direct principal contact</li>\n	<li>Free advisory (valuation and estate agency)</li>\n	<li>Non-exclusive agency agreement</li>\n	<li>Confidentiality and privacy</li>\n</ul>\n</div>\n[/span6]\n[/row]\n[row]\n[span12]\n<div class="service-boxes"></div>\n[/span12]\n[span6]\n<h3>Agency</h3>\n<p>Akinito is a Licenced Estate Agency.  It operates on a 100% online (www.akinito.com.au) eCommerce platform. No secretaries, no offices, just direct service from the principal himself.</p>\n<p>We prefer face to face contact and we come to you. How novel!</p>\n[/span6]\n[span6]\n<img src="http://localhost/akinito/wp-content/uploads/2011/07/service2-1.jpg" alt="" width="555" height="315" class="alignright size-full wp-image-2096" />\n[/span6]\n\n[/row]\n[row]\n[span12]\n<div class="service-boxes"></div>\n[/span12]\n[span6]\n<img src="http://localhost/akinito/wp-content/uploads/2011/07/service3-1.jpg" alt="" width="555" height="310" class="alignleft size-full wp-image-2097" />\n[/span6]\n[span6]\n<h3>Advisory</h3>\n<p>The principal of Akinito, Tass Pattas, is a qualified Valuer (AAPI) and a Licenced Estate Agent with Operations and Finance Expertise.  With tertiary qualifications in: Business (Property), Estate Agency, Applied Finance and Science he has over t25 years practical experience in the real estate industry as a developer, investor, estate agent and valuer.  This expertise can be accessed 24/7 as an Akinito member.</p>\n</ul>\n[/span6]\n[/row]', 'Services', '', 'inherit', 'closed', 'closed', '', '7-autosave-v1', '', '', '2017-05-29 09:41:23', '2017-05-29 09:41:23', '', 7, 'http://localhost/akinito/vivamus-eget-nibh/7-autosave-v1/', 0, 'revision', '', 0),
