(2116, 1, '2017-05-30 04:58:51', '2017-05-30 04:58:51', '[row]\r\n[span7]\r\n<h2 class="about-heading">Who We Are ?</h2>\r\nAkinito is an exclusive, elite, informed, online, licensed estate agency “for lovers of real estate and lifestyle”.\r\nWe differentiate from typical estate agents by believing that buyers and tenants - not vendors or landlords - drive the market place.\r\nBuyers and tenants are our primary focus and indirectly we assist vendors and landlords.\r\nOur high calibre members know what they want.\r\nOur members are typically experienced, high net worth individuals or corporate tenants who value their time and expect results.\r\nBy partnering with Akinito our members can enjoy their lifestyle whilst we get to work.\r\n[/span7]\r\n[/row]\r\n[row]\r\n[span6]\r\n<h2 class="about-heading">Why Do We Exist</h2>\r\nAkinito was created to take advantage of a significant service gap in the existing market place.  \r\nOur members have grown unaccustomed and frustrated with the current estate agency process including amongst other things:\r\n\r\n<ul>\r\n	<li>Having to narrowly select from properties available on the market rather than from a wish list which could include any property.</li>\r\n	<li>Chasing estate agents who are ‘Listings’ focused not buyer or tenant focused.</li>\r\n	<li>Flooded with marketing material via letter box drops that do not fulfil a need.</li>\r\n	<li>Attending auctions and competing with the retail pack.</li>\r\n	<li>Searching, searching, searching for sites with no success.</li>\r\n	<li>Lack of privacy and confidentiality.</li>\r\n	<li>....Time better spent on lifestyle than dealing with estate agents.</li>\r\n</ul>\r\n[/span6]\r\n[span6]\r\n<img src="http://localhost/akinito/wp-content/uploads/2013/07/about-content.jpg" alt="" width="599" height="399" class="alignleft size-full wp-image-2115" />\r\n[/span6]\r\n[/row]\r\n[row]\r\n[span6]\r\n<h2 class="about-heading">What We Do</h2>\r\nAt Akinito our approved clients become Members and our Members become part of the exclusive team. We like to keep it small and intimate though.  We are not all things to all people.  We value confidentiality and privacy.\r\n\r\nAkinito follows a four (4) step process:\r\nStep 1:  We conduct a member “Needs” analysis including time horizons;\r\nStep 2:  We agree on what success looks like;\r\nStep 3:  We enter into a non-exclusive agreement to act;\r\nStep 4:  We deliver.\r\n[/span6]\r\n[span6]\r\n<h2 class="about-heading">When Can I Join</h2>\r\nTo be considered for membership go to the home page and click on the relevant button. Membership benefits include:\r\n     <ul>\r\n	<li>Free 24/7 access to the principal;</li>\r\n	<li>Free direct principal contact</li>\r\n	<li>Free advisory (valuation and estate agency)</li>\r\n	<li>Non-exclusive agency agreement</li>\r\n	<li>Confidentiality and privacy</li>\r\n</ul>\r\n[/span6]\r\n[/row]\r\n[row]\r\n[span12]\r\n<h2 class="about-heading">Where Are We Located</h2>\r\nAkinito is 100% online (www.akinito.com.au). No secretaries, no offices, just direct service from the principal himself.\r\n\r\nWe prefer face to face contact and we come to you. \r\n[/span12]\r\n[/row]', 'About Us', '', 'inherit', 'closed', 'closed', '', '1889-revision-v1', '', '', '2017-05-30 04:58:51', '2017-05-30 04:58:51', '', 1889, 'http://localhost/akinito/vivamus-eget-nibh/1889-revision-v1/', 0, 'revision', '', 0),
(2117, 1, '2017-05-30 05:02:07', '2017-05-30 05:02:07', '[row]\r\n[span7]\r\n<h2 class="about-heading">Who We Are ?</h2>\r\nAkinito is an exclusive, elite, informed, online, licensed estate agency “for lovers of real estate and lifestyle”.\r\nWe differentiate from typical estate agents by believing that buyers and tenants - not vendors or landlords - drive the market place.\r\nBuyers and tenants are our primary focus and indirectly we assist vendors and landlords.\r\nOur high calibre members know what they want.\r\nOur members are typically experienced, high net worth individuals or corporate tenants who value their time and expect results.\r\nBy partnering with Akinito our members can enjoy their lifestyle whilst we get to work.\r\n[/span7]\r\n[/row]\r\n[spacer/]\r\n[row]\r\n[span6]\r\n<h2 class="about-heading">Why Do We Exist</h2>\r\nAkinito was created to take advantage of a significant service gap in the existing market place.  \r\nOur members have grown unaccustomed and frustrated with the current estate agency process including amongst other things:\r\n\r\n<ul>\r\n	<li>Having to narrowly select from properties available on the market rather than from a wish list which could include any property.</li>\r\n	<li>Chasing estate agents who are ‘Listings’ focused not buyer or tenant focused.</li>\r\n	<li>Flooded with marketing material via letter box drops that do not fulfil a need.</li>\r\n	<li>Attending auctions and competing with the retail pack.</li>\r\n	<li>Searching, searching, searching for sites with no success.</li>\r\n	<li>Lack of privacy and confidentiality.</li>\r\n	<li>....Time better spent on lifestyle than dealing with estate agents.</li>\r\n</ul>\r\n[/span6]\r\n[span6]\r\n<img src="http://localhost/akinito/wp-content/uploads/2013/07/about-content.jpg" alt="" width="599" height="399" class="alignleft size-full wp-image-2115" />\r\n[/span6]\r\n[/row]\r\n[row]\r\n[span6]\r\n<h2 class="about-heading">What We Do</h2>\r\nAt Akinito our approved clients become Members and our Members become part of the exclusive team. We like to keep it small and intimate though.  We are not all things to all people.  We value confidentiality and privacy.\r\n\r\nAkinito follows a four (4) step process:\r\nStep 1:  We conduct a member “Needs” analysis including time horizons;\r\nStep 2:  We agree on what success looks like;\r\nStep 3:  We enter into a non-exclusive agreement to act;\r\nStep 4:  We deliver.\r\n[/span6]\r\n[span6]\r\n<h2 class="about-heading">When Can I Join</h2>\r\nTo be considered for membership go to the home page and click on the relevant button. Membership benefits include:\r\n     <ul>\r\n	<li>Free 24/7 access to the principal;</li>\r\n	<li>Free direct principal contact</li>\r\n	<li>Free advisory (valuation and estate agency)</li>\r\n	<li>Non-exclusive agency agreement</li>\r\n	<li>Confidentiality and privacy</li>\r\n</ul>\r\n[/span6]\r\n[/row]\r\n[row]\r\n[span12]\r\n<h2 class="about-heading">Where Are We Located</h2>\r\nAkinito is 100% online (www.akinito.com.au). No secretaries, no offices, just direct service from the principal himself.\r\n\r\nWe prefer face to face contact and we come to you. \r\n[/span12]\r\n[/row]', 'About Us', '', 'inherit', 'closed', 'closed', '', '1889-revision-v1', '', '', '2017-05-30 05:02:07', '2017-05-30 05:02:07', '', 1889, 'http://localhost/akinito/vivamus-eget-nibh/1889-revision-v1/', 0, 'revision', '', 0),
