(2124, 1, '2017-05-30 06:11:36', '2017-05-30 06:11:36', '[row]\r\n[span12]\r\n<h2 class="member-title">Developer</h2>\r\nWe don’t always support the traditional development approach. The risks congregate at the front end with funds tied up during an uncertain planning process. Also, cash flows are non-existent until completion. Therefore, our approach is both traditional (eg: contracts of sale) and non-traditional processes (eg: options) depending on the member’s risk appetite and expertise.\r\n[/span12]\r\n[/row]\r\n[row]\r\n[span12]\r\n[gravityform id="1" title="false" description="false"]\r\n[/span12]\r\n[/row]', 'Developer', '', 'publish', 'closed', 'closed', '', 'developer', '', '', '2017-05-30 08:32:18', '2017-05-30 08:32:18', '', 2037, 'http://localhost/akinito/?page_id=2124', 0, 'page', '', 0),
