(2126, 1, '2017-05-30 06:12:17', '2017-05-30 06:12:17', '[row]\r\n[span12]\r\n<h2 class="member-title">Investor</h2>\r\nInvesting can be difficult at the best of times.  We chase the investment you want, we don’t wait for the investment to come to you.  Our members often prefer quality over price and are prepared to wait if it means their needs are met.Other members are discount and ROI driven.\r\n[/span12]\r\n[/row]\r\n[row]\r\n[span12]\r\n[gravityform id="3" title="false" description="false"]\r\n[/span12]\r\n[/row]', 'Investor', '', 'publish', 'closed', 'closed', '', 'investor', '', '', '2017-05-31 03:03:07', '2017-05-31 03:03:07', '', 2037, 'http://localhost/akinito/?page_id=2126', 0, 'page', '', 0),
