(2128, 1, '2017-05-30 06:13:05', '2017-05-30 06:13:05', '[row]\r\n[span12]\r\n<h2 class="member-title">Tenants</h2>\r\nThe rise of the national and international tenant requires a site acquisition process that goes over an above the traditional search and find process.  Because we don’t wait for the site the come to you a tailored program allows tenants to expand in a non-traditional and more efficient manner.\r\n[/span12]\r\n[/row]\r\n[row]\r\n[span12]\r\n[gravityform id="5" title="false" description="false"]\r\n[/span12]\r\n[/row]', 'Tenants', '', 'publish', 'closed', 'closed', '', 'tenants', '', '', '2017-05-31 03:53:45', '2017-05-31 03:53:45', '', 2037, 'http://localhost/akinito/?page_id=2128', 0, 'page', '', 0),
