(2130, 1, '2017-05-30 06:14:24', '2017-05-30 06:14:24', '[row]\r\n[span12]\r\n<h2 class="member-title">Owner</h2>\r\nIf you\'re tired of spending marketing dollars and months end on end deliberating on offers that eventually lead to nothing we are for you.  At Akinito we only talk to you if we have a buyer or tenant.  You only transact is you are comfortable with the offer hence no time wasted.\r\n[/span12]\r\n[/row]\r\n[row]\r\n[span12]\r\n[gravityform id="4" title="false" description="false"]\r\n[/span12]\r\n[/row]', 'Owner', '', 'publish', 'closed', 'closed', '', 'owner', '', '', '2017-05-31 03:44:10', '2017-05-31 03:44:10', '', 2037, 'http://localhost/akinito/?page_id=2130', 0, 'page', '', 0),
