(2178, 1, '2017-05-31 21:31:12', '2017-05-31 11:31:12', '[row]\r\n[span3][easyrotator]erc_92_1495696203[/easyrotator]\r\n<h3>You are a Developer</h3>\r\n<a class="home-more" href="http://localhost/akinito/become-a-member/developer/">More</a>[/span3]\r\n[span3][easyrotator]erc_65_1495701779[/easyrotator]\r\n<h3>You are a Investor</h3>\r\n<a class="home-more" href="http://localhost/akinito/become-a-member/investor/">More</a>[/span3]\r\n[span3][easyrotator]erc_44_1495702204[/easyrotator]\r\n<h3>You are a Tenant</h3>\r\n<a class="home-more" href="http://localhost/akinito/become-a-member/tenants/">More</a>[/span3]\r\n[span3][easyrotator]erc_79_1495703056[/easyrotator]\r\n<h3>Owner</h3>\r\n<a class="home-more" href="http://localhost/akinito/become-a-member/owner/">More</a>[/span3]\r\n[/row]', 'Home', '', 'inherit', 'closed', 'closed', '', '203-revision-v1', '', '', '2017-05-31 21:31:12', '2017-05-31 11:31:12', '', 203, 'http://localhost/akinito/vivamus-eget-nibh/203-revision-v1/', 0, 'revision', '', 0),
(2179, 1, '2017-05-31 21:40:54', '2017-05-31 11:40:54', '[spacer/]\r\n[row]\r\n[span12]\r\n<div class="service-boxes"></div>\r\n[/span12]\r\n[span6]\r\n<div class="service-img clearfix"><img class="alignleft size-full wp-image-2094" src="http://localhost/akinito/wp-content/uploads/2011/07/service1-2.jpg" alt="" width="555" height="315" /></div>\r\n[/span6]\r\n[span6]\r\n<div class="service-boxes">\r\n<h3>Membership</h3>\r\nAkinito is an exclusive, elite, informed, online, licensed estate agency “for lovers of real estate and lifestyle”. Our members are typically experienced, high net worth individuals or corporate tenants who value their time and expect results. By partnering with Akinito our members can enjoy their lifestyle whilst we get to work. Membership benefits include :\r\n<ul>\r\n 	<li>Free 24/7 access to the principal</li>\r\n 	<li>Free direct principal contact</li>\r\n 	<li>Free advisory (valuation and estate agency)</li>\r\n 	<li>Non-exclusive agency agreement</li>\r\n 	<li>Confidentiality and privacy</li>\r\n</ul>\r\n</div>\r\n[/span6]\r\n[/row]\r\n[spacer/]\r\n[row]\r\n[span12]\r\n<div class="service-boxes"></div>\r\n[/span12]\r\n[span6]\r\n<div class="service-boxes">\r\n<h3>Agency</h3>\r\nAkinito is a Licenced Estate Agency. It operates on a 100% online (www.akinito.com.au) eCommerce platform. No secretaries, no offices, just direct service from the principal himself.\r\n\r\n&nbsp;\r\n\r\nWe prefer face to face contact and we come to you. How novel!\r\n\r\n</div>\r\n[/span6]\r\n[span6]\r\n<div class="service-img clearfix"><img class="alignright size-full wp-image-2096" src="http://localhost/akinito/wp-content/uploads/2011/07/service2-1.jpg" alt="" width="555" height="315" /></div>\r\n[/span6]\r\n\r\n[/row]\r\n[spacer/]\r\n[row]\r\n[span12]\r\n<div class="service-boxes"></div>\r\n[/span12]\r\n[span6]\r\n<div class="service-img clearfix"><img class="alignleft size-full wp-image-2097" src="http://localhost/akinito/wp-content/uploads/2011/07/service3-1.jpg" alt="" width="555" height="310" /></div>\r\n[/span6]\r\n[span6]\r\n<div class="service-boxes">\r\n<h3>Advisory</h3>\r\nThe principal of Akinito, Tass Pattas, is a qualified Valuer (AAPI) and a Licenced Estate Agent with Operations and Finance Expertise. With tertiary qualifications in: Business (Property), Estate Agency, Applied Finance and Science he has over t25 years practical experience in the real estate industry as a developer, investor, estate agent and valuer. This expertise can be accessed 24/7 as an Akinito member.\r\n\r\n</div>\r\n[/span6]\r\n[/row]', 'Services', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2017-05-31 21:40:54', '2017-05-31 11:40:54', '', 7, 'http://localhost/akinito/vivamus-eget-nibh/7-revision-v1/', 0, 'revision', '', 0),
